import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "./Community.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrashAlt, faInfoCircle } from '@fortawesome/free-solid-svg-icons';

function CommunityDashboard() {
  const [communities, setCommunities] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchCommunities() {
      try {
        const response = await axios.get('http://your-django-api-url/communities');
        setCommunities(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching communities:', error);
      }
    }

    fetchCommunities();
  }, []);

  const handleDeleteCommunity = async (communityId) => {
    try {
      await axios.delete(`http://your-django-api-url/communities/${communityId}`);
      // Update state to reflect the deletion
      setCommunities(communities.filter((community) => community.id !== communityId));
    } catch (error) {
      console.error('Error deleting community:', error);
    }
  };

  return (
    <div>
      <h2>Community Dashboard</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {communities.map((community) => (
            <li key={community.id}>
              {community.community_name}
              <button onClick={() => handleDeleteCommunity(community.id)}>
                <FontAwesomeIcon icon={faTrashAlt} />
              </button>
              <button>
                <FontAwesomeIcon icon={faInfoCircle} />
              </button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default CommunityDashboard;
